import React from "react";
import Btn from "./startLearnBtn";

class LeftGuide extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      show: 0
    };
    //  const title = props.data.map(item => item.name);
    //  const detail = props.data.map(item => item.detail);
  }

  render() {
    return (
      <>
        {this.props.courseName.map((item, index) => {
          return <button key={index}>{item}</button>;
        })}
      </>
    );
  }
}
